def png_to_jpeg_converter(filePath='/content/covid_data/COVID-19'):

    inputPath = Path(filePath)
    inputFiles = inputPath.glob("**/*.png")
    outputPath = Path(filePath)
    for f in inputFiles:
        outputFile = outputPath / Path(f.stem + ".jpg")
        im = Image.open(f)
        im.save(outputFile)
        try:
            f.unlink()
        except OSError as e:
            print(f"Error:{ e.strerror}")

